import { useState, useEffect } from 'react';
import './FilePreview.css';

function FilePreview() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/videos")
      .then((res) => res.json())
      .then((data) => {
        let divs = [];
        data.array.forEach(element => {
          divs.push(
          <div key={element} className="file-preview__container">
            <img className=".file-preview__thumbnail" src="https://scx2.b-cdn.net/gfx/news/2017/1-snapchat.jpg" alt="" width="5%"/>
            <div className=".file-preview__name">{element}</div>
          </div>
          );
        });
        setData(divs);
      })
  }, []);

  return (
      <div className="file-preview__body">
        {/* Create loading screen instead of text */}
        {!data ? "Loading..." : data}
      </div>
  );
}

export default FilePreview;
